import React from 'react'
import {Tabs} from 'antd'

const {TabPane} = Tabs
function Profilescreen() {
    return (
        <div>
            <Tabs>
                <TabPane></TabPane>
            </Tabs>            
        </div>
    )
}

export default Profilescreen
